import React from "react";
import "./avaliablejob.css";
import { Link } from "react-router-dom"


function AvaliableJobs() {
  return (
    <>
      <div className="container-fluid px-2 px-md-3 px-lg-5 container available-job">
        <div className="job-wrapper p-5">
          <div className="section-frist">
            <h1>
              Available Jobs <sup>(9)</sup>
            </h1>
            <div className="nav-link">
                <Link to="">Latest Job</Link>
                <Link to="">Female Only</Link>
                <Link to="">Latest Job</Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default AvaliableJobs;
